  [],\n\t\"revision_timestamp\": \"2016-07-27T22:21:39.619122\",\n\t\"name\": \"the-1971-waterfowl-botulism-outbreak-in-the-tulare-lake-basin\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The efforts of the Department of Fish and
  Game and the U.S. Bureau of Sport Fisheries and Wildlife held botulism losses in
  the Tulare Lake region of the Southern San Joaquin valley to approximately (1700)
  birds. Of the 968 sick birds which were caught and treated all but 94 recovered.
  This outbreak was a result of agricultural flooding with the last remnants of water
  impounded during the 1969 flood. Pintails comprised 38.53 percent of the dead birds
  with Green-winged Teal running second with a 32.53 percent loss.\",\n\t\"license_title\":
